import React, {Component} from "react";
import { Link, animateScroll as scroll } from "react-scroll";
import {Container, Navbar, Nav} from "react-bootstrap";

class Headers extends Component {
    scrollToTop = () => {
        scroll.scrollToTop();
    };

    render() {
        const {t} = this.props;
        return (
            <nav className="nav" id="navbar">
                <div className="nav-content">
                <ul className="nav-items">
                <li className="nav-item">
                    <Link
                        activeClass="active"
                        to="section1"
                        spy={true}
                        href="#home"
                        smooth={true}
                        offset={-70}
                        duration={1000}
                    ></Link>
                </li>
                <li className="nav-item">
                    <Link
                        activeClass="active"
                        to="section2"
                        spy={true}
                        smooth={true}
                        offset={-70}
                        duration={1000}
                    >
                        Section 2
                    </Link>
                </li>
                <li className="nav-item">
                    <Link
                        activeClass="active"
                        to="section3"
                        spy={true}
                        smooth={true}
                        offset={-70}
                        duration={1000}
                    >
                        Section 3
                    </Link>
                </li>
                <li className="nav-item">
                    <Link
                        activeClass="active"
                        to="section4"
                        spy={true}
                        smooth={true}
                        offset={-70}
                        duration={1000}
                    >
                        Section 4
                    </Link>
                </li>
                <li className="nav-item">
                    <Link
                        activeClass="active"
                        to="section5"
                        spy={true}
                        smooth={true}
                        offset={-70}
                        duration={1000}
                    >
                        Section 5
                    </Link>
                </li>
            </ul>
                </div>
            </nav>
        )
    }
}


export default Headers;
